import React from "react";
import "./style.css";
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';
import { Link } from "react-router-dom";

const Manu = () => {

  return (
    <>
    
      <div class="rc_nav" id="centered_nav">
      <h1 id="title">Sayaib Sarkar</h1>
        
        <Link exact activeClassName="active_class" className="nav-link" to="/">
          Home
        </Link>
        <Link exact activeClassName="active_class" className="nav-link" to="/portfolio">
        Portfolio
        </Link>
        <Link exact activeClassName="active_class" className="nav-link" to="/Codes">
        Codes
        </Link>
        <Link exact activeClassName="active_class" className="nav-link" to="/contact">
        Contact
        </Link>
      </div>
    </>
  );
};

export default Manu;
